package array;

public class FloatExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		float[] value =new float [10];                // output 1234
		                                              //  4321
		                                              // 45678
		value[0]=1234;
		value[1]=4321;
		value[2]=45678;
		for(int i=0;i<value.length;i++) {
			System.out.println(value[i]);
		}

	}

}
